import styles from './styles.module.css';
import React, { useEffect, useState } from 'react';
import { useNavigate, useParams, useLocation } from 'react-router-dom';
import { useDispatch, useSelector } from 'react-redux';
import { showUserList } from 'features/usersSlice';
import {
  getMessageList,
  showMessageList,
  getMessageListAsync,
} from 'features/messagesSlice';

export const Messages = () => {
  console.log(user);
  let location = useLocation();
  let currentUser = location.state.name;
  let id = location.state.id;

  console.log(currentUser, id);
  const dispatch = useDispatch();
  let currentMessages = useSelector(state => state.messages.messageList);

  useEffect(() => {
    dispatch(getMessageListAsync(currentUser));
  }, []);
  return (
    <div>
      {currentMessages.map((val, key) => {
        return <p> {val} </p>;
      })}
    </div>
  );
};
